import React from "react";

const Home = () => {
    return (
        <>
            <h1 className="text-2xl font-bold">
                Hello world!
            </h1>
            <div className="text-center text-lg text-green-300 bg-slate-600 mx-[100px]">Lorem ipsum dolor sit amet consectetur, adipisicing elit. Velit cupiditate ut voluptas tempora commodi praesentium accusamus non magni, exercitationem, dolore, ipsa tenetur obcaecati reprehenderit quae harum rerum cumque cum repellendus!</div>
        </>
    );
};

export default Home;
